import React from 'react'
import ExidioLogo from '../images/ExidioLogo.png'
import '../css/home_navbar.css'

function home_navbar() {
    return (
        <div>
            <image src={ExidioLogo} className="exidioLogo" />
        </div>
    )
}

export default home_navbar
